const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p><button class="badge-blue">ENTERPRISE PLANS ONLY</button></p>
If you are an organization admin, you can create and delete teams and assign concurrency limits to each team.
    <h2 {...{
      "id": "adding-teams"
    }}>{`Adding Teams`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`In Sauce Labs, click `}<strong parentName="p">{`Account`}</strong>{` and then click `}<strong parentName="p">{`Team Management`}</strong>{`.`}</p>
        <img src={useBaseUrl('img/team-mgmt/team-mgmt-nav.jpg')} alt="Team management navigation" width="400" />
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`Teams`}</strong>{` tab, click the blue plus sign.`}</p>
        <img src={useBaseUrl('img/team-mgmt/add-new-team-nav.jpg')} alt="Add new team" />
      </li>
    </ol>
    <ol {...{
      "start": 3
    }}>
      <li parentName="ol">{`In the `}<strong parentName="li">{`Create new team`}</strong>{` box, enter a team name and description.`}</li>
    </ol>
    <img src={useBaseUrl('img/team-mgmt/create-new-team.jpg')} alt="Create new team" width="400" />
    <ol {...{
      "start": 4
    }}>
      <li parentName="ol">{`In the `}<strong parentName="li">{`To Line of Business`}</strong>{` dropdown, select the line of business the team will be associated with.`}</li>
      <li parentName="ol">{`Under `}<strong parentName="li">{`Team VM Concurrency Limits`}</strong>{`, use the up and down arrows to set the number of concurrent virtual machines that the team can access. For more information about concurrency, see `}<a parentName="li" {...{
          "href": "/basics/acct-team-mgmt/concurrency-limits"
        }}>{`Concurrency Limits and Team Accounts`}</a>{`.`}</li>
      <li parentName="ol">{`Click `}<strong parentName="li">{`Add Team`}</strong>{`.`}</li>
    </ol>
    <h2 {...{
      "id": "deleting-teams"
    }}>{`Deleting Teams`}</h2>
    <ol>
      <li parentName="ol">{`In Sauce Labs, click `}<strong parentName="li">{`Account`}</strong>{` and then click `}<strong parentName="li">{`Team Management`}</strong>{`.`}</li>
      <li parentName="ol">{`On the `}<strong parentName="li">{`Teams`}</strong>{` tab, select the checkbox of the team or teams you want to delete.`}</li>
      <li parentName="ol">{`Next to `}<strong parentName="li">{`Teams Selected`}</strong>{`, in the `}<strong parentName="li">{`Action`}</strong>{` dropdown, click `}<strong parentName="li">{`Delete team`}</strong>{`.`}</li>
    </ol>
    <img src={useBaseUrl('img/team-mgmt/delete-team.jpg')} alt="Delete team" />
    <ol {...{
      "start": 4
    }}>
      <li parentName="ol">{`In the `}<strong parentName="li">{`Confirm Delete`}</strong>{` box, select the team that you want to transfer the members of the deleted team to. If you don't select a a new team, the team members will be moved to the default team.   `}</li>
      <li parentName="ol">{`Click `}<strong parentName="li">{`Yes, Remove`}</strong>{`.`}</li>
    </ol>
    </MDXLayout>;
}

;
